import { motion, useAnimation, AnimatePresence, useMotionValue } from 'framer-motion';
import { useState } from 'react';

export const Example = () => {
  const [activeDemo, setActiveDemo] = useState(null);
  const [score, setScore] = useState(0);
  const [gameStarted, setGameStarted] = useState(false);
  const [targets, setTargets] = useState([]);
  const controlsArray = [...Array(16)].map(() => useAnimation());

  const generateTargets = () => {
    return [...Array(3)].map((_, i) => ({
      id: i,
      x: Math.random() * 252,
      y: Math.random() * 252,
      collected: false,
    }));
  };

  const startGame = () => {
    setScore(0);
    setTargets(generateTargets());
    setGameStarted(true);
  };

  const demos = [
    {
      title: 'Collect The Stars ‚≠ê',
      color: 'bg-gradient-to-r from-purple-500 to-pink-500',
      content: (
        <div className="relative w-[300px] h-[300px] bg-black/10 rounded-lg p-4">
          {!gameStarted ? (
            <motion.button
              className="absolute top-1/2 left-1/2 -translate-x-1/2 -translate-y-1/2 
                         px-6 py-3 bg-white/20 rounded-lg text-white font-bold"
              whileHover={{ scale: 1.1 }}
              whileTap={{ scale: 0.95 }}
              onClick={startGame}
            >
              Start Game
            </motion.button>
          ) : (
            <>
              <CollectTheStarsGame
                targets={targets}
                setTargets={setTargets}
                score={score}
                setScore={setScore}
                setGameStarted={setGameStarted}
              />
              <div className="absolute top-4 right-4 text-white font-bold">
                Score: {score}
              </div>
            </>
          )}
        </div>
      ),
    },
    {
      title: 'Chain Reaction üîÑ',
      color: 'bg-gradient-to-r from-blue-500 to-teal-500',
      content: (
        <div className="grid grid-cols-4 gap-2">
          {[...Array(16)].map((_, i) => (
            <motion.div
              key={i}
              className="aspect-square bg-white/20 rounded-lg"
              onHoverStart={() => {
                controlsArray[i].start('active');
                const neighbors = [];
                if (i % 4 !== 0) neighbors.push(i - 1); // left
                if (i % 4 !== 3) neighbors.push(i + 1); // right
                if (i >= 4) neighbors.push(i - 4); // top
                if (i < 12) neighbors.push(i + 4); // bottom
                neighbors.forEach((n) => {
                  controlsArray[n].start('neighbor');
                });
              }}
              animate={controlsArray[i]}
              variants={{
                active: {
                  scale: [1, 1.5, 1],
                  rotate: 360,
                  transition: { duration: 0.5 },
                },
                neighbor: {
                  scale: [1, 1.2, 1],
                  transition: { duration: 0.3, delay: 0.1 },
                },
              }}
            />
          ))}
        </div>
      ),
    },
    {
      title: 'Music Visualizer üéµ',
      color: 'bg-gradient-to-r from-orange-500 to-red-500',
      content: (
        <div className="flex items-end justify-center h-48 gap-1">
          {[...Array(20)].map((_, i) => (
            <motion.div
              key={i}
              className="w-4 bg-white/20 rounded-t-lg"
              animate={{
                height: [20, 100, 20],
              }}
              transition={{
                duration: 1 + Math.random(),
                repeat: Infinity,
                repeatType: 'reverse',
                delay: i * 0.05,
              }}
              whileHover={{
                backgroundColor: 'rgba(255,255,255,0.4)',
                scale: 1.2,
              }}
            />
          ))}
        </div>
      ),
    },
    {
      title: 'Particle Tunnel üåÄ',
      color: 'bg-gradient-to-r from-green-500 to-yellow-500',
      content: (
        <div className="relative h-48">
          {[...Array(20)].map((_, i) => (
            <motion.div
              key={i}
              className="absolute left-1/2 top-1/2 w-2 h-2 bg-white/40 rounded-full"
              animate={{
                scale: [0, 3, 0],
                opacity: [0, 1, 0],
                rotate: [0, 360],
              }}
              transition={{
                duration: 2,
                repeat: Infinity,
                delay: i * 0.1,
                ease: 'linear',
              }}
              style={{
                rotate: `${i * 18}deg`,
              }}
            />
          ))}
        </div>
      ),
    },
    {
      title: 'Bouncing Ball üèÄ',
      color: 'bg-gradient-to-r from-indigo-500 to-purple-500',
      content: (
        <div className="flex items-center justify-center h-48">
          <motion.div
            className="w-12 h-12 bg-white/20 rounded-full"
            animate={{
              y: [0, -100, 0],
            }}
            transition={{
              duration: 1,
              repeat: Infinity,
              ease: 'easeInOut',
            }}
          />
        </div>
      ),
    },
    {
      title: 'Drag and Drop List üìã',
      color: 'bg-gradient-to-r from-pink-500 to-red-500',
      content: <DragAndDropList />,
    },
  ];

  return (
    <div className="flex flex-col items-center justify-center min-h-[600px] p-8">
      <div className="grid grid-cols-2 gap-4 mb-8 w-full max-w-2xl">
        {demos.map((demo, index) => (
          <motion.button
            key={index}
            className={`${demo.color} p-6 rounded-xl text-white font-bold text-lg`}
            whileHover={{ scale: 1.02 }}
            whileTap={{ scale: 0.98 }}
            onClick={() => setActiveDemo(activeDemo === index ? null : index)}
          >
            {demo.title}
          </motion.button>
        ))}
      </div>

      <AnimatePresence mode="wait">
        {activeDemo !== null && (
          <motion.div
            key={activeDemo}
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            exit={{ opacity: 0, y: -20 }}
            className={`${demos[activeDemo].color} p-8 rounded-xl w-full max-w-2xl`}
          >
            {demos[activeDemo].content}
          </motion.div>
        )}
      </AnimatePresence>
    </div>
  );
};

const CollectTheStarsGame = ({ targets, setTargets, score, setScore, setGameStarted }) => {
  const x = useMotionValue(0);
  const y = useMotionValue(0);

  return (
    <>
      <motion.div
        className="w-12 h-12 bg-white/20 rounded-lg absolute cursor-grab flex items-center justify-center"
        drag
        dragConstraints={{ top: 0, left: 0, right: 252, bottom: 252 }}
        whileDrag={{ scale: 1.2 }}
        style={{ x, y }}
        onDragEnd={() => {
          const currentX = x.get();
          const currentY = y.get();

          const newTargets = targets.map((target) => {
            if (!target.collected) {
              const distance = Math.hypot(currentX - target.x, currentY - target.y);
              if (distance < 30) {
                setScore((prev) => prev + 1);
                return { ...target, collected: true };
              }
            }
            return target;
          });

          setTargets(newTargets);

          if (newTargets.every((target) => target.collected)) {
            setGameStarted(false);
          }
        }}
      >
        üöÄ
      </motion.div>
      {targets.map(
        (target, i) =>
          !target.collected && (
            <motion.div
              key={i}
              className="absolute w-8 h-8 flex items-center justify-center"
              style={{ left: target.x, top: target.y }}
              animate={{
                scale: [1, 1.2, 1],
                rotate: [0, 180, 360],
              }}
              transition={{
                duration: 2,
                repeat: Infinity,
              }}
            >
              ‚≠ê
            </motion.div>
          )
      )}
    </>
  );
};

const DragAndDropList = () => {
  const [items, setItems] = useState([...Array(5)].map((_, i) => `Item ${i + 1}`));

  const onDragEnd = (event, info) => {
    const fromIndex = parseInt(event.currentTarget.dataset.index);
    const toIndex = Math.round((info.point.y - 100) / 50);

    const newItems = [...items];
    const [movedItem] = newItems.splice(fromIndex, 1);
    newItems.splice(toIndex, 0, movedItem);
    setItems(newItems);
  };

  return (
    <div className="w-64 mx-auto">
      {items.map((item, index) => (
        <motion.div
          key={item}
          className="p-4 bg-white/20 rounded-lg mb-2 cursor-grab"
          drag="y"
          dragConstraints={{ top: -index * 50, bottom: (items.length - index - 1) * 50 }}
          data-index={index}
          onDragEnd={onDragEnd}
        >
          {item}
        </motion.div>
      ))}
    </div>
  );
};
